import React from "react";
import { useState } from "react";
export default function WeatherNext(props) {
  const { lon, lat } = props;
  const { weatherfour, setWeatherfour } = useState();
  const fetchfour = async (e) => {
    e.preventDefault();
    const response = await axios.get(
      `https://api.openweathermap.org/data/2.5/onecall?lat=${lat}&lon=${lon}&exclude={part}&appid=fe4feefa8543e06d4f3c66d92c61b69c`
    );
    setWeatherfour(response.data);
  };
  return (
    <>
      <h1>{weatherfour.lat}</h1>
    </>
  );
}
